import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import { Button, Card, Row, Col, CardGroup} from 'react-bootstrap';


function App() {
  const [todolist, settodo] = useState([]);

  useEffect( () => {
    axios.get('todos')
      .then(res => {
        settodo(res.data);
      })
      .catch(err => {
        console.log(err)
      })

  },[])
  return (
    <div>
      <CardGroup>
        {
          todolist.map(data =>{
            return (
              <Col>
              <Card bg="secondary" text='white' border="primary" style={{width: '30rem'}} key={data.id}>
                <Card.Body>{data.title}</Card.Body>
                <Card.Text>{data.description}</Card.Text>
              </Card>
              </Col>

            )
          } 
            )
        }
        </CardGroup>
    </div>
  );
}

export default App;
